import React from "react";
import "./styles/Resume.css"
import SchoolOutlinedIcon from '@material-ui/icons/SchoolOutlined';
import CodeOutlinedIcon from '@material-ui/icons/CodeOutlined';
import BuildOutlinedIcon from '@material-ui/icons/BuildOutlined';

function Resume(){
  return(
    <div className={"main-content"}>
      <h3>{`<Resume/>`}</h3>
      <div className={"education-box"}>
        <span className={"resume-titles"}>Education</span>
        <SchoolOutlinedIcon className={"resume-icon"}/>
        <p>Duke University (2019 - Present)</p>
        <p>Major: Computer Science & Economics (B.S.)</p>
        <p>Programming Coursework: Data Structures & Algorithms, Discrete Mathematics*, Mobile Programming*, Databases*</p>
        <p style={{fontSize: "18px"}}>*currently taking</p>
      </div>
      <div className={"experience-box"}>
        <span className={"resume-titles"}>Experience</span>
        <BuildOutlinedIcon className={"resume-icon"}/>
      </div>
      <div className={"tools-box"}>
        <span className={"resume-titles"}>Technologies</span>
        <CodeOutlinedIcon className={"resume-icon"}/>
      </div>
    </div>
  )
}

export default Resume;
